import './App.css';
import Login from './Login';


function App() {
  return (
    <div className="App">
      <header className="App-header">

      <div className="signin-block">
        <h2 className="signin-header">Sign In</h2>

        <div className="signin-input">
          <input type="email" id="loginEmail" placeholder="Email address"></input>
        </div>

        <div className="signin-input">
          <input type="password" id="loginPassword" placeholder="Password"></input>
        </div>

        <button className="signin-button btn btn-dark">Login</button>
      </div>
      </header>
    </div>
  );
}

export default App;
